comments:
Great location, walking distance to restaurants and public transport. Andy was friendly and responsive. Just two things that should have been stated on the listing;
1) Washer and dryer are in the shared backyard and requires $10 of coins to operate. We were looking for a place with private laundry, so was disappointed.
2) Refundable S$50 was required per access keycard. We were caught by surprise and had our Singapore dollars tied up for a few days, which was pretty inconvenient. Being a cashless society and trying to carry limited foreign current, it was difficult to have our limited cash tied up.
